import { createRouter, createWebHistory } from 'vue-router'
import MainPage from '../components/MainPage' // 추가된 MainPage 컴포넌트
import DBList from '../components/DBList'
import SmsHistory from '../components/SmsHistory'
import ThresholdList from '../components/ThresholdList'
import TablespacesList from "@/components/TablespacesList.vue"; // 컴포넌트 이름 변경


const routes = [
  {
    path: '/',
    name: 'MainPage',
    component: MainPage, // 메인 페이지로 라우팅
  },
  {
    path: '/db-list',
    name: 'DBList',
    component: DBList,
  },
  {
    path: '/sms-history',
    name: 'SmsHistory',
    component: SmsHistory,
  },
  {
    path: '/threshold-list',
    name: 'ThresholdList',
    component: ThresholdList,
  },
   {
    path: "/tb-list", // 경로 정의
    name: "Tablespaces",
    component: Tablespaces, // TbList.vue 컴포넌트와 연결
    }
]

const router = createRouter({
  history: createWebHistory(),
  routes,
})

export default router
